import React from "react";

const FilterForm = ({ filters, setFilters }) => {
  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent the page from reloading
    // You can further handle additional logic here if needed
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4">
      {/* Category */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Category</label>
        <input
          type="text"
          value={filters.category}
          onChange={(e) => setFilters({ ...filters, category: e.target.value })}
          className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
        />
      </div>

      {/* Price Range */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Price Range</label>
        <div className="flex space-x-2">
          <input
            type="number"
            placeholder="Min"
            value={filters.minPrice}
            onChange={(e) => setFilters({ ...filters, minPrice: e.target.value })}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
          />
          <input
            type="number"
            placeholder="Max"
            value={filters.maxPrice}
            onChange={(e) => setFilters({ ...filters, maxPrice: e.target.value })}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
          />
        </div>
      </div>

      {/* Size */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Size</label>
        <input
          type="text"
          value={filters.size}
          onChange={(e) => setFilters({ ...filters, size: e.target.value })}
          className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
        />
      </div>

      {/* Color */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Color</label>
        <input
          type="text"
          value={filters.color}
          onChange={(e) => setFilters({ ...filters, color: e.target.value })}
          className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
        />
      </div>

      {/* Designer */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Designer</label>
        <input
          type="text"
          value={filters.designer}
          onChange={(e) => setFilters({ ...filters, designer: e.target.value })}
          className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
        />
      </div>

      {/* Rating */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Rating</label>
        <input
          type="number"
          value={filters.rating}
          min="1"
          max="5"
          onChange={(e) => setFilters({ ...filters, rating: e.target.value })}
          className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
        />
      </div>

      {/* Apply Filters Button */}
      <button
        type="submit"
        className="w-full py-2 px-4 bg-blue-600 text-white rounded-md"
      >
        Apply Filters
      </button>
    </form>
  );
};

export default FilterForm;
